import React, { useState } from 'react';
import axios from 'axios';
import { Link, useNavigate } from 'react-router-dom';
import './SignupPage.css';

const SignupPage = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState('');
  const [isLoading, setIsLoading] = useState(false);
  const navigate = useNavigate();

  const handleSignup = async (e) => {
    e.preventDefault();
    setIsLoading(true);
    setError('');
    
    try {
      const response = await axios.post('http://localhost:5000/api/auth/signup', {
        email,
        password,
      });
      
      if (response.data.success) {
        navigate('/login');
      } else {
        setError(response.data.message || 'Registration failed');
      }
    } catch (error) {
      setError(error.response?.data?.message || 'Registration failed. Please try again.');
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <div className="signup-container">
      <nav className="signup-nav">
        <Link to="/" className="netflix-logo">
          <svg viewBox="0 0 111 30" className="netflix-svg">
            <g id="netflix-logo">
              <path d="M105.06233,14.2806261 L110.999156,30 C109.249227,29.7497422 107.500234,29.4366857 105.718437,29.1554972 L102.374168,20.4686475 L98.9371075,28.4375293 C97.2499766,28.1563408 95.5928391,28.061674 93.9057081,27.8432843 L99.9372012,14.0931671 L94.4680851,-5.68434189e-14 L99.5313525,-5.68434189e-14 L102.593495,7.87421502 L105.874965,-5.68434189e-14 L110.999156,-5.68434189e-14 L105.06233,14.2806261 Z" fill="#e50914"></path>
            </g>
          </svg>
        </Link>
        <Link to="/login" className="signin-link">Sign In</Link>
      </nav>
      
      <div className="signup-content">
        <div className="signup-wrapper">
          <div className="signup-steps">
            <span className="step-indicator">STEP 1 OF 3</span>
            <h1 className="signup-title">Create a password to start your membership</h1>
            <p className="signup-subtitle">Just a few more steps and you're done!</p>
          </div>
          
          {error && <div className="signup-error">{error}</div>}
          
          <form onSubmit={handleSignup} className="signup-form">
            <div className="form-group">
              <input
                type="email"
                placeholder="Email"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
                required
              />
            </div>
            
            <div className="form-group">
              <input
                type="password"
                placeholder="Add a password"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                minLength="6"
                required
              />
            </div>
            
            <div className="password-requirements">
              <p>Your password must contain between 6 and 60 characters.</p>
            </div>
            
            <button 
              type="submit" 
              className="signup-button"
              disabled={isLoading}
            >
              {isLoading ? 'Setting up your account...' : 'Next'}
            </button>
          </form>
          
          <div className="signup-footer">
            <p className="signup-terms">
              By clicking "Next", you agree to our <Link to="/terms">Terms of Use</Link> and acknowledge that you have read our <Link to="/privacy">Privacy Policy</Link>.
            </p>
            <p className="recaptcha-notice">
              This page is protected by Google reCAPTCHA to ensure you're not a bot. <button className="learn-more">Learn more</button>.
            </p>
          </div>
        </div>
      </div>
      
      <footer className="signup-footer-bottom">
        <div className="footer-content">
          <p>Questions? Call 1-844-505-2993</p>
          <div className="footer-links">
            <Link to="/help">FAQ</Link>
            <Link to="/privacy">Privacy</Link>
            <Link to="/cookies">Cookie Preferences</Link>
            <Link to="/corporate">Corporate Information</Link>
          </div>
          <div className="language-selector">
            <select>
              <option value="en">English</option>
              <option value="es">Espa√±ol</option>
            </select>
          </div>
        </div>
      </footer>
    </div>
  );
};

export default SignupPage;
